SELECT COALESCE("t4"."C_CUSTKEY", "t4"."C_CUSTKEY") AS "C_CUSTKEY", "t4"."C_NAME", "t4"."TOTAL_SPENT", "t4"."SPEND_RANK", "t15"."r_regionkey", "t15"."r_name", "t15"."r_comment", "t15"."n_nationkey", "t15"."n_name", "t15"."n_regionkey", "t15"."n_comment", "t15"."s_suppkey", "t15"."s_name", "t15"."s_address", "t15"."s_nationkey", "t15"."s_phone", "t15"."s_acctbal", "t15"."s_comment", "t15"."S_SUPPKEY" AS "S_SUPPKEY_", "t15"."S_NAME" AS "S_NAME_", "t15"."TOTAL_SUPPLY_COST", "t15"."UNIQUE_PARTS", "t15"."C_CUSTKEY" AS "C_CUSTKEY0", "t15"."C_NAME" AS "C_NAME0", "t15"."TOTAL_SPENT" AS "TOTAL_SPENT0"
FROM (SELECT "t"."c_custkey" AS "C_CUSTKEY", "t"."c_name" AS "C_NAME", SUM("t2"."TOTAL_DISCOUNTED_PRICE") AS "TOTAL_SPENT", RANK() OVER (ORDER BY SUM("t2"."TOTAL_DISCOUNTED_PRICE") DESC NULLS FIRST) AS "SPEND_RANK"
