LEFT JOIN (SELECT "t0"."o_orderkey" AS "O_ORDERKEY", "t0"."o_orderdate" AS "O_ORDERDATE", SUM("lineitem"."l_extendedprice" * (1 - "lineitem"."l_discount")) AS "TOTAL_DISCOUNTED_PRICE"
FROM (SELECT *
