RIGHT JOIN "TPCH"."customer" AS "customer0" ON "orders1"."o_custkey" = "customer0"."c_custkey") AS "t5"
LEFT JOIN (SELECT "t6"."o_orderkey" AS "O_ORDERKEY", "t6"."o_orderdate" AS "O_ORDERDATE", SUM("lineitem0"."l_extendedprice" * (1 - "lineitem0"."l_discount")) AS "TOTAL_DISCOUNTED_PRICE"
FROM (SELECT *
