FROM (SELECT "t10"."r_regionkey", "t10"."r_name", "t10"."r_comment", "t10"."n_nationkey", "t10"."n_name", "t10"."n_regionkey", "t10"."n_comment", "supplier"."s_suppkey", "supplier"."s_name", "supplier"."s_address", "supplier"."s_nationkey", "supplier"."s_phone", "supplier"."s_acctbal", "supplier"."s_comment"
