GROUP BY "supplier0"."s_suppkey", "supplier0"."s_name") AS "t13" ON "t11"."s_suppkey" = "t13"."S_SUPPKEY") AS "t14" ON "t9"."c_custkey" = "t14"."n_nationkey0") AS "t15" ON "t4"."C_CUSTKEY" = "t15"."C_CUSTKEY"